import React from "react";
import "./NavBar.css";
import { useIsAuthenticated } from "react-auth-kit";

function NavBar() {
  const isAuthenticated = useIsAuthenticated();

  return (
    <div className="navbar-container">
      <h2 className="main-title">Grove Burner</h2>
      <ul>
        {isAuthenticated() ? <li>Home</li> : null}
        {isAuthenticated() ? <li>Bulid a Grovelist</li> : null}
        {isAuthenticated() ? <li>Bulid a G</li> : null}
      </ul>
    </div>
  );
}

export default NavBar;
